import './App.css';

// import FieldSet from 'react-native-fieldset';
import { View, Text } from 'react-native';


function App() {
  return (
    <>
      <div className="bg-green-300 h-20 flex justify-center text-6xl">Chat-App</div>
      <div className='bg-gray-500 h-40 my-3 flex justify-center'>
        <form action="">
          <View>
            <FieldSet label="Fieldset label">
              <Text>Field Set Body</Text>
            </FieldSet>
          </View>
        </form>
      </div>
    </>
  );
}

export default App;
